import React from "react";
import "../style/like.css";
import { useContext } from "react";
import { CustomContext } from "../../utils/Context";

function Like() {
  const [favored, setFvored] = useContext(CustomContext);

  return <div>
    {favored.map()}
  </div>;
}

export default Like;
